CBRE as exclusive selling agents are pleased to present 38.43ha’s of englobo residential development land to the southeast of the existing Reef Estate, Two Rocks. 

With potential for 640* lots, (637 single residential / 3 grouped housing sites) this property offers a fantastic coastal opportunity on the eastern side of Two Rocks Road, 60km* north of the Perth CBD.

Key features include;
- 38.43ha* residential development site with services in place for immediate development
- Subdivision potential for 637 single residential lots and 3 grouped housing sites;
- Ocean views from the land which rises west to east;
- Less than 10km to the future Yanchep Train Station;
- Located on Perth’s northern beaches in one of the cities fastest growing residential corridors.

A trending residential coastal region, local residents nominate access to fantastic beaches, government services, parklands and other amenities as key reasons why they choose to live on the northern beaches of Perth. The City of Wanneroo forecasts growth in the Northern Coastal Corridor of Alkimos, Eglinton, Yanchep and Two Rocks to increase by 110,000 people by 2041 representing 51% of the City of Wanneroo’s total growth. 

The property is offered for sale via Expressions of Interest.

Please contact the agent for further information.

CBRE and Jones Lang LaSalle are delighted to offer this ideal development site in the heart of the Byford Town Centre.

Highlights of the development site include:

* 32.288 ha of Urban Development Land;
* Subdivision Approval applications lodged;
* Well drained site ready for development;
* Prelim plans show a potential lot yield of 375 lots.

Offers to Purchase close at the offices of CBRE Perth or Jones Lang LaSalle Perth at 2pm WST Thursday 6th December 2012.  To be sold together or seperately with Byford on the Scarp (Real Commercial Listing No.  200404455).

Please contact the Joint Exclusive Selling Agents for further information.
